     /**
     * Método que le da la matriz al Sudoku y llama al método solucion de la clase ResulveSudoku
     */
    public void creaSudokuPosible(){

            int matriz[][] = new int[9][9];
            Sudoku sud = new Sudoku(llenaMatriz(matriz));
            ResuelveSudoku.solucion(sud);
            pasaInterface(sud);
            System.out.print(sud.toString());
    }
    
